<?php/* This is ref on http://www.lomont.org/Math/Papers/2008/Lomont_PRNG_2008.pdf *//*Note : Well512_Rand AlgorithmLicense : MITAuthor : GiPyeongLeeDate : 2016/10/18*/class W512_Rand {  function declareGlobalFunction () {    function w512_rand() {		$timestamp = microtime(true)*10000;		$timestamp.=strrev($timestamp);		$number = substr($timestamp,0,16);		$state = array_map('intval', str_split($number)); // init 				$index = 0;				$a;$b;$c;$d;		$a = $state[$index];		$c = $state[($index+13)&15];		$b = $a^$c^($a<<16)^($c<<15);		$c = $state[($index+9)&15];		$c ^= ($c>>11);		$a = $state[$index] = $b^$c;		$d = $a^(($a<<5)&0xDA442D24);		$index = ($index + 15)&15;		$a = $state[$index];		$state[$index] = $a^$b^$d^($a<<2)^($b<<18)^($c<<28);		return $state[$index];	}  }}$time_start = microtime(true); $well512_rand = new Well512_Rand();$well512_rand->declareGlobalFunction();error_log("result : ".w512_rand()."\n");$time_end = microtime(true);error_log("execute time : ".($time_end-$time_start)."\n");?>